pragma solidity ^0.8.0;
abstract contract Ownable is Context {
    address private _owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);


    constructor() {
        _transferOwnership(_msgSender());
    }


    modifier onlyOwner() {
        _checkOwner();
        _;
    }


    function owner() public view virtual returns (address) {
        return _owner;
    }


    function _checkOwner() internal view virtual {
        require(owner() == _msgSender(), "Ownable: caller is not the owner");
    }


    function renounceOwnership() public virtual onlyOwner {
        _transferOwnership(address(0));
    }


    function transferOwnership(address newOwner) public virtual onlyOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        _transferOwnership(newOwner);
    }


    function _transferOwnership(address newOwner) internal virtual {
        address oldOwner = _owner;
        _owner = newOwner;
        emit OwnershipTransferred(oldOwner, newOwner);
    }
}

pragma solidity ^0.8.4;
interface IERC20 {
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
    function totalSupply() external view returns (uint256);
    function balanceOf(address account) external view returns (uint256);
    function transfer(address to, uint256 amount) external returns (bool);
    function allowance(address owner, address spender) external view returns (uint256);
    function approve(address spender, uint256 amount) external returns (bool);
    function transferFrom(
        address from,
        address to,
        uint256 amount
    ) external returns (bool);
}
interface i1155{
    struct NFTEA {
        uint256 nftea;
        address[] addresses;
        uint256[] settings;
    }
    function fire(address caller_) external pure returns(uint256[] memory,uint256[] memory,uint256,bool,bool,uint256);
    function gflame(string memory flame_) external pure returns(address);
    function getoperator(address operator_, uint256 license_) external pure returns(uint256[4] memory,uint256[] memory,uint256,uint256,uint256,uint256,address);
    function getContract(address contract_) external returns(bool);
    function getnftea(uint256 nftea_) external pure returns(NFTEA memory,string[] memory, string memory);
    function setmint(uint256 nftea_, bool newmint_, address sendto_, bool cantransfer_) external pure returns(bool);
    function getbag(uint256 nftea_, address wallet_) external pure returns(address,uint256,uint256);
    function setdisplay(uint256 label_, uint256 nft_, uint256 type_) external returns(bool);
    function _ondisplay(uint256 nftea) external pure returns(bool);
    function setGasRefund(address holder_, uint256 gas_) external returns(bool);
    function updateoperator(uint256 labelnftea_, address to_) external returns(bool);
    function checksuperop(uint256 license_, address operator_) external pure returns(address);

    }
contract minter is Ownable,ERC1155, ERC1155Supply{
    using SafeMath for uint256;
    event new_mint(
        address minter,
        uint256 nftea,
        string ipfs,
        string label
    );
    event Display(uint256 nftea, bool status);

    string public name = "NFTea.app";
    string public symbol = "NfTEA";
    address public _fire;
    uint256 public _nftea;
    mapping(uint256=>string) public _ipfs;
    mapping(string=>uint256) public _ipfs2nftea;
    address public _burn = 0x000000000000000000000000000000000000dEaD;
    mapping(address=>bool) public _flagged;
    mapping(uint256=>mapping(address=>bool)) public _nftea2flag;
    mapping(uint256=>uint256) public _transferable;
    mapping(uint256=>address) public _nftea2wallet;
    mapping(address=>bool) private _iswallet;
    mapping(address=>uint256[]) public _mynfteas;
    mapping(address=>mapping(uint256=>uint256)) public _mynfteasx;
    mapping(uint256=>address[]) public _holders;
    mapping(uint256=>mapping(address=>uint256)) public _holdersx;
    mapping(uint256=>bool) public _allowTransfer;
    mapping(uint256=>bool) public _onDisplay;
    mapping(address=>bool) public _displayBann;
    mapping(uint256=>uint256) public _displayexpire;
    uint256[] public _displays;
    mapping(uint256=>uint256) public _displaysx;
    uint256 public _minTea2Display;
    i1155.NFTEA _nfteas;


    constructor(address fire_) ERC1155("https://nftea.app/public/nftea/{id}.json") {
        _nftea = 0;
        _fire = fire_;
        _minTea2Display =0;
    }

    function setflag(address recipient_, bool value_, uint256 nftea_) external returns(bool){

        (bool success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not an admin minter 1');

        _flagged[recipient_] = value_;
        if(nftea_>0){
            _nftea2flag[nftea_][recipient_] = value_;
        }
        return true;
    }
    function settransferable(uint256 nftea_, uint256 value_, address wallet_) external returns (bool){
        ///world3 called only on mint
        (bool success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not an admin minter 2');

        _transferable[nftea_] = value_;
        _nftea2wallet[nftea_] = wallet_;
        if(wallet_!=address(0)){
            _iswallet[wallet_] = true;
        }
        return true;
    }
    function setwallet(address wallet_) external returns(bool){
        (bool success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not an admin minter 3');
        _iswallet[wallet_] = true;
        return true;
    }
    function mint(uint256 assetid_, string memory ipfs_, address sendto_, uint256[] memory settings_, string memory label_) external returns(uint256){

        (bool success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not an admin minter 4');
        bool newmint_ = false;
        if(assetid_<1){
            _nftea +=1;
            assetid_ = _nftea;
            _ipfs[assetid_] = ipfs_;
            _ipfs2nftea[ipfs_] = assetid_;
            newmint_ = true;
        }
        _transferable[assetid_] = settings_[9];
        _mint(sendto_, assetid_, settings_[6], '');
        emit new_mint(sendto_,assetid_,_ipfs[_nftea], label_);
        return assetid_;
    }
    function allowTransfer(uint256 nftea_, bool value_) external returns(bool) {

        (bool success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not an admin minter 5');
        _allowTransfer[nftea_] = value_;
        return true;

    }
    function setedit(uint256 nftea_, string memory ipfs_) external returns(bool){
        (bool success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not valid caller');
            _ipfs2nftea[ipfs_] = nftea_;
            _ipfs[nftea_] = ipfs_;

        return true;
    }
    function getmynfteas(address holder_) public view returns(uint256[] memory,string[] memory, uint256[] memory, uint256[] memory){

        string[] memory ipfs_ = new string[](_mynfteas[holder_].length);
        uint256[] memory bnbbalance_ = new uint256[](_mynfteas[holder_].length);
        uint256[] memory teabalance_ = new uint256[](_mynfteas[holder_].length);
        (address flame_) = i1155(_fire).gflame('teatoken');

        for (uint256 i = 0; i < _mynfteas[holder_].length; ++i) {

          ipfs_[i] = _ipfs[_mynfteas[holder_][i]];
          if(_nftea2wallet[_mynfteas[holder_][i]]!=address(0)){
            bnbbalance_[i] = _nftea2wallet[_mynfteas[holder_][i]].balance;
            teabalance_[i] = IERC20(flame_).balanceOf(_nftea2wallet[_mynfteas[holder_][i]]);
          }else{
            bnbbalance_[i] = 0;
            teabalance_[i] = 0;
          }
        }

        return(_mynfteas[holder_], ipfs_, bnbbalance_,teabalance_);
    }
    function getholders(uint256 nftea_) public view returns(address[] memory){
      return _holders[nftea_];
    }
    function getbag(uint256 nftea_, address holder_) public view returns(string memory, address, uint256[] memory, bool){

      (address flame_) = i1155(_fire).gflame('teatoken');
      string memory ipfs_ = _ipfs[nftea_];
      uint256[] memory numbers_ = new uint256[](5);
      bool onDisplay = _onDisplay[nftea_];
      numbers_[0] = _nftea2wallet[nftea_].balance;
      numbers_[1] = IERC20(flame_).balanceOf(_nftea2wallet[nftea_]);
      numbers_[2] = balanceOf(holder_, nftea_);
      (flame_) = i1155(_fire).gflame('baglogic');
      (,,uint256 brewdate_) = i1155(flame_).getbag(nftea_,_nftea2wallet[nftea_]);
      numbers_[3] = brewdate_;
      numbers_[4] = _transferable[nftea_];
      address bag_ = _nftea2wallet[nftea_];
      if(!onDisplay){
        (flame_) = i1155(_fire).gflame('shopstorage');
        (onDisplay) = i1155(flame_)._ondisplay(nftea_);
      }
      return(ipfs_,bag_,numbers_, onDisplay);
    }

    function setOnDisplay(uint256 nftea_, bool value_, address holder_) external returns(bool) {

      (bool success) = i1155(_fire).getContract(msg.sender);
      require(success, 'invalid caller');
      uint256 balance = balanceOf(holder_,nftea_);
      require(balance>0, 'you do not own this nftea');
      require(!_displayBann[holder_], 'banned from listing displays');
      if (_minTea2Display>0 && value_){
        (address flame_) = i1155(_fire).gflame('teatoken');
        require(IERC20(flame_).balanceOf(_nftea2wallet[nftea_])>=_minTea2Display, 'low bag balance');
      }

      if(value_){

        require(!_onDisplay[nftea_],'already on display');

        // Get the current block timestamp
        uint256 currentBlockTimestamp = block.timestamp;

        // Loop through the first 12 elements of the displays array
        if(_displays.length>49){
          for (uint256 i = 0; i < 49; ++i) {
            // Check if the display has expired
            if (currentBlockTimestamp > _displayexpire[_displays[i]]) {
              // Remove the expired display from the array and store the index
              uint256 index = _displays[_displays.length - 1];
              _displays[i] = _displays[index];
              _displays.pop();
              _onDisplay[_displays[i]] = false;
            }
          }
        }

        // If the value is true, add the NFT to the array
          _displays.push(nftea_);
          // Store the index of the NFT in the displaysx mapping
          _displaysx[nftea_] = _displays.length - 1;
          _displayexpire[nftea_] = block.timestamp + 6 hours;
          emit Display(nftea_, true);

        }else {
          // If the value is false, remove the NFT from the array
          if(_onDisplay[nftea_]){

            _displays[_displaysx[nftea_]] = _displays[_displays.length - 1];
            _displays.pop();
            _displayexpire[nftea_] = 0;
            emit Display(nftea_, false);

          }
        }
      _onDisplay[nftea_] = value_;
      return true;
    }
    function updatedisplay() public{
      uint256 startGas = gasleft();
      // Get the current block timestamp
      uint256 currentBlockTimestamp = block.timestamp;

      // Loop through the first 12 elements of the displays array
      if(_displays.length>0){
        for (uint256 i = 0; i < _displays.length; ++i) {
          // Check if the display has expired
          if (currentBlockTimestamp > _displayexpire[_displays[i]]) {
            // Remove the expired display from the array and store the index
            uint256 index = _displays[_displays.length - 1];
            _displays[i] = _displays[index];
            _displays.pop();
            _onDisplay[_displays[i]] = false;
          }
        }
      }
      uint256 endGas = gasleft();
      uint256 gasUsed = startGas - endGas;
      uint256 refundAmount = gasUsed * tx.gasprice;

      (address flame_) = i1155(_fire).gflame('teapot');
      (bool success) = i1155(flame_).setGasRefund(msg.sender,refundAmount);
      require(success, 'error settng gas refund');

    }

    function setDisplayBann(address user_) public {
      (bool success) = i1155(_fire).getContract(msg.sender);
      require(success, 'invalid caller');
      _displayBann[user_] = true;
    }
    function setMinTea2Display(uint256 value_) public {
      (bool success) = i1155(_fire).getContract(msg.sender);
      require(success, 'invalid caller');
      _minTea2Display = value_ *(10**9);
    }
    function getDisplays() public view returns(uint256[] memory,string[] memory, uint256[] memory, uint256[] memory,address[] memory){

      string[] memory ipfs_ = new string[](_displays.length);
      uint256[] memory bnbbalance_ = new uint256[](_displays.length);
      uint256[] memory teabalance_ = new uint256[](_displays.length);
      address[] memory bag_ = new address[](_displays.length);
      (address flame_) = i1155(_fire).gflame('teatoken');

      for (uint256 i = 0; i < _displays.length; ++i) {
        ipfs_[i] = _ipfs[_displays[i]];
        bnbbalance_[i] = _nftea2wallet[_displays[i]].balance;
        teabalance_[i] = IERC20(flame_).balanceOf(_nftea2wallet[_displays[i]]);
        bag_[i] = _nftea2wallet[_displays[i]];
      }
      return(_displays, ipfs_, bnbbalance_,teabalance_, bag_);
    }
    function tokenURI(uint256 tokenId) public view returns (string memory) {
        return _ipfs[tokenId];
    }
    function getipfs(string memory ipfs_) public view returns(uint256){
        return _ipfs2nftea[ipfs_];
    }

    function _beforeTokenTransfer(address operator, address from, address to, uint256[] memory ids, uint256[] memory amounts, bytes memory data)
    internal
    override(ERC1155, ERC1155Supply)
    {
        for (uint256 i = 0; i < ids.length; ++i) {
            require(!_flagged[to] && !_nftea2flag[ids[i]][to], 'flagged recipient');
            (address shop_) = i1155(_fire).gflame('shoplogic');
            //allow transfer to user operated wallet
            if(from!=address(0)){
                ///this is NOT a mint
                if(_transferable[ids[i]]<1){

                    (address flame_) = i1155(_fire).gflame('mintstorage');
                    (_nfteas,,) = i1155(flame_).getnftea(ids[i]);
                    //can only transfer to wallet owned by holder or shop or burn
                    if(totalSupply(ids[i])>1){

                        address operator_ =address(0);
                        if(_nfteas.settings[3]==5){
                          (flame_) = i1155(_fire).gflame('operatorstorage');
                          (address oper_) = i1155(flame_).checksuperop(ids[i], from);
                          operator_ = oper_;
                        }
                        require(from == operator_ || to==_burn || to==_nfteas.addresses[0] || to==_nfteas.addresses[1] || from==shop_ || from==_nfteas.addresses[0] || from==_nfteas.addresses[1], 'limited transfers');
                        require(to!=_nfteas.addresses[2], 'self wallet transfer not allowed');

                    }else{

                        require(from == shop_ || (to==shop_ && _nfteas.settings[3]==1) || to==_burn || to==_nfteas.addresses[0] || to==_nfteas.addresses[1] || _allowTransfer[ids[i]], 'cannot transfer lead labels');
                        if(_allowTransfer[ids[i]]){
                            _allowTransfer[ids[i]] = false;
                        }
                    }
                 }
                 if(totalSupply(ids[i])==1){
                   if(to!=shop_ && to!=_burn){
                     (address flame__) = i1155(_fire).gflame('operatorstorage');
                     (bool success) = i1155(flame__).updateoperator(ids[i],to);
                     require(success, 'error updating operator');
                   }
                 }
                uint256 balance_ = balanceOf(from,ids[i]);
                if(balance_.sub(amounts[i])<1){

                    _mynfteas[from][_mynfteasx[from][ids[i]]] = _mynfteas[from][_mynfteas[from].length - 1];
                    _mynfteas[from].pop();
                    _holders[ids[i]][_holdersx[ids[i]][from]] = _holders[ids[i]][_holders[ids[i]].length - 1];
                    _holders[ids[i]].pop();

                }
            }
            uint256 balanceto_ = balanceOf(to,ids[i]);
            if(balanceto_==0){
                _mynfteas[to].push(ids[i]);
                _mynfteasx[to][ids[i]] = _mynfteas[to].length - 1;
                _holders[ids[i]].push(to);
                _holdersx[ids[i]][to] = _holders[ids[i]].length - 1;
            }
        }
        super._beforeTokenTransfer(operator, from, to, ids, amounts, data);
    }
}
